import ListMaps from './ListMaps'
import PermissionsMixin from '@/components/common/PermissionsMixin'
import { mapGetters } from 'vuex'
import * as TYPE from '@/actionTypes.js'

export default {
  name: 'MWListMaps',
  components: { ListMaps },
  mixins: [PermissionsMixin],
  data: () => {
    return {
      fields: [
        {
          key: 'selected'
        },
        {
          key: 'marketplace',
          label: 'MARKETPLACE'
        },
        {
          key: 'name',
          label: 'Brand Name'
        },
        {
          key: 'sku',
          label: 'SKU'
        },
        {
          key: 'asin',
          label: 'ASIN'
        },
        {
          key: 'upc',
          label: 'UPC/EAN'
        },
        {
          key: 'price',
          label: 'MAP Price'
        },
        {
          key: 'last_violation_checked',
          label: 'Last Completed'
        },
        {
          key: 'type',
          label: 'Type'
        },
        {
          key: 'discovered_asins',
          label: 'Discovered Asin(s)'
        },
        {
          key: 'actions',
          label: 'Actions'
        }
      ]
    }
  },
  computed: {
    ...mapGetters({
      planConfig: `mw/${TYPE.GET_PLAN_CONFIG}`,
      organizationStats: `mw/${TYPE.GET_ORGANIZATION_STATS}`
    }),
    checkMaxAsinOfOrganizationPlan() {
      if (this.organizationStats['asin_for_amazon_used'] > this.planConfig['max_of_asin_for_amazon']) {
        return true
      }
      return false
    }
  },
  destroyed() {
    this.$store.state.mw.maps.currentPage = 1
  }
}
